import React from "react";
import sprite from "../../images/sprite.svg";
import s from "./Home.module.scss";

export const Home = () => {
  return (
    <div className={s.container}>
      <div className={s.wrapperLogo}>
        <svg className={s.logo}>
          <use href={`${sprite}#logo`} />
        </svg>
        <p>Finance </p>
      </div>
    </div>
  );
};
